public List<GuestBookVO> getGuestBookList(){ List<GuestBookVO> list = new ArrayList<>(); GuestBookVO vo = null; Connection conn = null; PreparedStatement ps = null; ResultSet rs = null; try { conn = DBUtil.getConnection(); String sql = "select * from guestbook"; ps = conn.prepareStatement(sql); rs = ps.executeQuery(); while(rs.next()){ vo = new GuestBookVO(); vo.setNo(rs.getInt(1)); vo.setId(rs.getString(2)); vo.setTitle(rs.getString(3)); vo.setConetnt(rs.getString(4)); vo.setRegDate(rs.getString(5)); list.add(vo); } } catch (Exception e) { e.printStackTrace(); } finally { DBUtil.close(conn, ps, rs); } return list; } // ADD
public int addGuestBook(GuestBookVO vo){ int result = 0; Connection conn = null; PreparedStatement ps = null; try { conn = DBUtil.getConnection(); String sql = "insert into guestbook values(" + "guestbook_seq.nextval,?,?,?,sysdate)"; ps = conn.prepareStatement(sql); ps.setString(1, vo.getId()); ps.setString(2, vo.getTitle()); ps.setString(3, vo.getConetnt()); result = ps.executeUpdate(); } catch (Exception e) { e.printStackTrace(); } finally { DBUtil.close(conn, ps); } return result;
} // CLOSE
